import React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import Login from './components/login-component';

function App() {
  return (
    <div>
      <Routes>
      <Route path="/login"
        render={(props) => (
          <Login {...props} login={Login} />
        )}
      />
      </Routes>
    </div>
  )
}

export default App;
